import React from 'react';
import styles from './Hero.module.css';
import Image from 'next/image';
const Hero = () => {
  return (
    <div className={styles.hero}>
      <div className={styles.heroImageContainer}>
        <Image
          src="/icehands.png"
          alt="three hands holding ice cream cones"
          width={1150}
          height={600}
        />
      </div>
    </div>
  );
};

export default Hero;
